import React from "react";
import { styled } from "styled-components";

const WorkItemStyle = styled.section``;

const WorkItems = [
  { title: "website", url: "", img: "./flower.jpg", text: "仮想サイトの制作" },
  {
    title: "app",
    url: "",
    img: "./flower.jpg",
    text: "Reactを用いたポケモン図鑑アプリ",
  },
  {
    title: "practice",
    url: "",
    img: "./flower.jpg",
    text: "その他模写やマークアップなど",
  },
];

const WorkItem = ({ title, url, img, text }) => {
  return (
    <WorkItemStyle>
      <div>
        <h2>{WorkItems[0].title}</h2>
        <a href={WorkItems[0].url}>01</a>
        <img src={WorkItems[0].img} />
        <p>{WorkItems[0].text}</p>
      </div>
      <div>
        <h2>{WorkItems[1].title}</h2>
        <a href={WorkItems[1].url}>01</a>
        <img src={WorkItems[1].img} />
        <p>{WorkItems[1].text}</p>
      </div>
      <div>
        <h2>{WorkItems[2].title}</h2>
        <a href={WorkItems[2].url}>01</a>
        <img src={WorkItems[2].img} />
        <p>{WorkItems[2].text}</p>
      </div>
    </WorkItemStyle>
  );
};

export default WorkItem;
